import React from "react";
import { Link } from "react-router-dom";
import { FaSearch } from "react-icons/fa"; // Importing a search icon

const Welcome = () => {
    return (
        <div className="flex flex-col items-center justify-center min-h-screen bg-navy text-white">
            <h1 className="text-5xl font-bold">Campus<span className="text-gold">Connect!</span></h1>
            <p className="text-lg mt-2">Find buildings and locations with ease.</p>

            {/* Search Bar */}
            <div className="relative mt-4">
                <input 
                    type="text"
                    placeholder="What are you looking for?..."
                    className="input input-bordered input-lg w-80 pr-12 text-black"
                />
                <button className="absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-600">
                    <FaSearch className="text-lg" />
                </button>
            </div>

            {/* Quick Navigation Buttons */}
            <div className="mt-6 flex gap-4">
                <Link to="/building/library" className="btn bg-blue-500 text-white px-6 py-2 rounded">Library</Link>
                <Link to="/building/cafe" className="btn bg-gold text-white px-6 py-2 rounded">Cafe Campesino</Link>
                <Link to="/building/storm-dome" className="btn bg-gold text-white px-6 py-2 rounded">Storm Dome</Link>
                <Link to="/building/gymnasium" className="btn bg-gold text-white px-6 py-2 rounded">Gymnasium</Link>
            </div>
        </div>
    );
};

export default Welcome;
